getRandomSeriesTitles(excludeSeriesId: string, count: number): string[] {
  const seriesIds = Object.keys(this.seriesData).filter(id => id !== excludeSeriesId);
  const randomTitles: string[] = [];
  while (randomTitles.length < count && seriesIds.length > 0) {
    const randomIndex = Math.floor(Math.random() * seriesIds.length);
    const seriesId = seriesIds.splice(randomIndex, 1)[0];
    randomTitles.push(this.seriesData[seriesId]);
  }
  return randomTitles;
}
